import React, { useEffect, useState } from 'react';
import tmdb from './tmdb';

export default () => {


  const [movieList, setMovieList] = useState([]);


  useEffect(()=>{
    const loadAll = async () => {
      //Pegando lista TOTAL
      let list = await tmdb.getHomeList();
      setMovieList(list);
    }


    loadAll();

  }, []);

  return (
    <div className="page">
      Header
      Destaque
      As Listas
      Rodape basico
    </div>
  );
}
